import axios from "axios";
import { observable, runInAction, toJS } from "mobx";

let authMethods = observable({
  login: (loginData) => {
    axios({
      url: "http://localhost:8080/api/authenticate",
      method: "post",
      data: {
        loginData,
      },
    });
  },
});

export default authMethods;
